import React from 'react';
import SignIn from '../sign-in/sign-in.component';
import './sign-in-and-sign-up.style.scss';

const SignInAndSignUp = () => {
    return (
        <div className="sign-in-and-sign-up">
            <SignIn />
        </div>
    )
}
export default SignInAndSignUp;
